def checkkey(event):
    value = event.widget.get()
    if value == '':
        data = l
    else:
        data = []
        for item in l:
            if value.lower() in item.lower():
                data.append(item)
    update(data)

def update(data):
    lb.delete(0, 'end')
    for item in data:
        lb.insert('end', item)


